// GLOBAL VARIABLES --------------------------------------------
// buffer
int pixel_buffer_start;

// player variables
int x = PLAYER_X;  // player position - (0, 0) is top left
int y = PLAYER_Y;
int playerSpeed = 3;      // player speed (how many pixels they move per frame)
bool playerRight = true;  // direction of player - right/up display right facing
                          // sprite, left/down display left facing sprite
int score = 0;            // player score

// bullet variables
// set N to change # of bullets that can be on screen at a time
int Bdx = 0;  // instantaneous bullet dx dy for player position each frame -
              // this follows the direction the player is moving in
int Bdy = 0;
bool bulletArray[N] = {
    false};            // array to track each bullet currently on screen
int bulletX[N] = {0};  // current bullet position
int bulletY[N] = {0};
int bulletdX[N] = {
    0};  // bullet direction - straight line generated in this direction
int bulletdY[N] = {0};
int bulletSpeed = 1;  // bullet speed

// enemy variables
// set E_N to change # of enemies that can be on screen at a time
bool enemyArray[E_N] = {
    false};        // array to track each enemy currently on screen
int enemy_x[E_N];  // current position of enemy
int enemy_y[E_N];
bool ifvertical;  // true enemy from left/right edge, false if from up/down
int dx_e[E_N];    // direction of enemy
int dy_e[E_N];
int ind = 0;      // index to determine enemy animation each frame
int counter = 0;  // counter to set different speeds for enemies

// game state booleans
bool start = true;
bool end = false;

// audio
int shoot_n = 5424;
int death_n = 5924;
int back_n = 44922;
int start_n = 24484;

