// ------------------------------------------------------------
// initial sound
struct audio_t {
  volatile unsigned int control;
  volatile unsigned char rarc;
  volatile unsigned char ralc;
  volatile unsigned char wsrc;
  volatile unsigned char wslc;
  volatile unsigned int ldata;
  volatile unsigned int rdata;
};
struct audio_t *const audiop = ((struct audio_t *)0xff203040);

// MAIN --------------------------------------------------------
int main() {
  volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
  pixel_buffer_start = *pixel_ctrl_ptr;  // read location of the pixel buffer
                                         // from the pixel buffer controller

  volatile int *PS2_ptr = (int *)0xFF200100;  // PS2 port address

  // store current and previous 2 bytes of data (keyboard inputs)
  unsigned char byte1 = 0;
  unsigned char byte2 = 0;
  unsigned char byte3 = 0;
  // for reading data and checking validity of input
  int PS2_data, RVALID;
  *(PS2_ptr) = 0xFF;  // reset keyboard

  int xtemp,
      ytemp;  // temporary storage for potential next x and next y positions

  // game loop, allows game to restart
  while (1) {
    // start screen loop ------------------------------------------

    clear_screen();
    start_bg();
    while (start) {
      PS2_data = *(PS2_ptr);         // read the data register in the PS2 port
      RVALID = (PS2_data & 0x8000);  // extract the RVALID field

      if (RVALID != 0) {
        byte1 = byte2;
        byte2 = byte3;
        byte3 = PS2_data & 0xFF;

        if ((byte2 == 0xAA) && (byte3 == 0x00)) {
          // mouse inserted; initialize sending of data
          *(PS2_ptr) = 0xF4;
        }

        // press x to start
        if (byte3 == 0x22) {
          audio_playback_mono(start_sound, start_n);
          start = false;
        }
      }
    }

    // -----------------------------------------------------------
    // gameplay loop ---------------------------------------------

    // detect second button hold for diagonal movement
    unsigned char secondButton = 0x0;

    // gameplay background
    clear_screen();
    draw_bg();

    // gameplay loop (polling for player movements)
    // *change while condition to player life lost (loop until enemy touches
    // player)
    while (!end) {
      PS2_data = *(PS2_ptr);         // read the data register in the PS2 port
      RVALID = (PS2_data & 0x8000);  // extract the RVALID field

      // do nothing unless input detected
      if (RVALID != 0) {
        // always save the last three bytes received
        byte1 = byte2;
        byte2 = byte3;
        byte3 = PS2_data & 0xFF;

        if ((byte2 == 0xAA) && (byte3 == 0x00)) {
          // mouse inserted; initialize sending of data
          *(PS2_ptr) = 0xF4;
        }

        // if button is being released (scan code begins with F0)
        if (byte3 == 0xF0) {
          // read next
          byte1 = byte2;            // last button
          byte2 = byte3;            // F0
          byte3 = PS2_data & 0xFF;  // button that is released

          // disable second button as long as the key released is not space
          if (byte3 != 0x29) {
            secondButton = 0x0;
          }

        } else {  // press

          // check if second button is pressed (two buttons held down at once)
          // byte2 is last press of "second" button, byte3 is first press of
          // "first" button
          if ((byte2 == 0x1D || byte2 == 0x1C || byte2 == 0x1B ||
               byte2 == 0x23) &&
              (byte3 == 0x1D || byte3 == 0x1C || byte3 == 0x1B ||
               byte3 == 0x23) &&
              byte2 != byte3 && byte1 != 0xF0) {
            secondButton = byte2;
          }

          // check if WASD or space (shoot) is pressed
          // separating them keeps the direction of the previous movement for
          // the bullet
          if (byte3 == 0x1D || byte3 == 0x1C || byte3 == 0x1B ||
              byte3 == 0x23) {
            // initialize bullet direction
            Bdx = 0;
            Bdy = 0;

            // poll for WASD for both current and second button
            // set player position and bullet direction in case space is pressed
            // on next button set direction of sprite (facing left or right)
            if (byte3 == 0x1D || secondButton == 0x1D) {  // key = W (up)
              xtemp = x;
              ytemp = y - playerSpeed;
              if (y - playerSpeed >= 1 &&
                  !imaginary_borders(xtemp, ytemp))  // edge checker
                y -= playerSpeed;
              Bdy = -bulletSpeed;
              playerRight = true;
            }

            if (byte3 == 0x1C || secondButton == 0x1C) {  // key = A (left)
              xtemp = x - playerSpeed;
              ytemp = y;
              if (x - playerSpeed >= 1 && !imaginary_borders(xtemp, ytemp))
                x -= playerSpeed;
              Bdx = -bulletSpeed;
              playerRight = false;
            }

            if (byte3 == 0x1B || secondButton == 0x1B) {  // key = S (down)
              xtemp = x;
              ytemp = y + playerSpeed;
              if (y + playerSpeed < HEIGHT - PLAYER_HEIGHT &&
                  !imaginary_borders(xtemp, ytemp))
                y += playerSpeed;
              Bdy = bulletSpeed;
              playerRight = false;
            }

            if (byte3 == 0x23 || secondButton == 0x23) {  // key = D (right)
              xtemp = x + playerSpeed;
              ytemp = y;
              if (x + playerSpeed < WIDTH - PLAYER_WIDTH &&
                  !imaginary_borders(xtemp, ytemp))
                x += playerSpeed;
              Bdx = bulletSpeed;
              playerRight = true;
            }

          } else if (byte3 == 0x29 && byte2 != 0XF0) {  // key = space (shoot)
            // check byte2 is not 0xF0 so that bullet is not shot on space bar
            // release
            // ensure bullet has a direction to move in
            // play audio
            audio_playback_mono(shoot, shoot_n);
            if (Bdx == 0 && Bdy == 0) {
              Bdx = 0;
              Bdy = bulletSpeed;
            }

            // check for free space in bullet arrays and store bullet data
            check_store_bullet();
            // check_store_enemy();
          }
        }
      }

      // change bullet positions
      get_bullet_pos();

      // spawn enemies
      generate_enemy();

      // draw everything
      // draw player sprite depending on direction they're facing
      if (playerRight) {
        draw_box_R(x, y);
      } else {
        draw_box_L(x, y);
      }

      // draw all enemies in array
      draw_enemy();
      // change enemy animation every frame
      ind++;
      if (ind == 3) {
        ind = 0;
      }

      // draw all bullets in array
      draw_bullet(0xFFFFFF);

      // draw score on gameplay screen
      draw_score();

      wait_for_vsync();  // wait for vsync to clear everything

      // clear everything
      clear_box(x, y);
      clear_bullet();
      clear_enemy();
      clear_score();
    }

    // --------------------------------------------------------------
    // end screen while loop ----------------------------------------
    clear_screen();
    end_bg();
    end_score();

    while (end) {
      PS2_data = *(PS2_ptr);         // read the data register in the PS2 port
      RVALID = (PS2_data & 0x8000);  // extract the RVALID field

      if (RVALID != 0) {
        byte1 = byte2;
        byte2 = byte3;
        byte3 = PS2_data & 0xFF;

        if ((byte2 == 0xAA) && (byte3 == 0x00)) {
          // mouse inserted; initialize sending of data
          *(PS2_ptr) = 0xF4;
        }

        // restart the game
        if (byte3 == 0x2D) {
          end = false;
          start = true;

          // reset all variables
          reset();
        }
      }
    }
  }

  // --------------------------------------------------------------
}

// ----------------------------------------------------------------
// FUNCTIONS ------------------------------------------------------

// general --------------------------------------------------------
// clear screen to black
void clear_screen() {
  int y, x;
  for (x = 0; x < 320; x++)
    for (y = 0; y < 240; y++) plot_pixel(x, y, 0);
}

// wait for vsync
void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr = (int *)0xff203020;  // base address
  int status;
  *pixel_ctrl_ptr = 1;  // start the synchronization process
  // write 1 into front buffer address register

  status = *(pixel_ctrl_ptr + 3);  // read the status register

  // polling loop waiting for S bit to go to 0
  while ((status & 0x01) != 0) {
    status = *(pixel_ctrl_ptr + 3);
  }  // loop/function exits when status bit goes to 0
}

// plot one pixel
void plot_pixel(int x, int y, short int line_color) {
  volatile short int *one_pixel_address;
  one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
  *one_pixel_address = line_color;
}

// reset game
void reset() {
  // reset player position
  x = PLAYER_X;
  y = PLAYER_Y;

  // reset score
  score = 0;

  // reset bullets
  for (int i = 0; i < N; i++) {
    bulletX[i] = 0;
    bulletY[i] = 0;
    bulletdX[i] = 0;
    bulletdY[i] = 0;
    bulletArray[i] = false;
  }

  // reset enemies
  for (int i = 0; i < E_N; i++) {
    enemy_x[i] = 0;  // current position of enemy
    enemy_y[i] = 0;
    dx_e[i] = 0;  // direction of enemy
    dy_e[i] = 0;
    enemyArray[i] = false;
  }

  // reset enemy animation variables
  ind = 0;
  counter = 0;
}
