// right facing sprite
void draw_box_R(int x0, int y0) {
  int y, x;
  for (x = 0; x < PLAYER_WIDTH; x++) {
    for (y = 0; y < PLAYER_HEIGHT; y++) {
      // change all transparent (65535) pixels to background
      if (playerSprite[y][x] != 65535) {
        plot_pixel(x0 + x, y0 + y, playerSprite[y][x]);
      }
    }
  }
}

// left facing sprite - reverses x when plotting
