// bullet functions -----------------------------------------------
// check for space in bullet array and store new bullet
void check_store_bullet() {
  for (int i = 0; i < N; i++) {
    // check for space in bullet array
    if (!bulletArray[i]) {
      // set new bullet position to player's current position (middle of sprite)
      bulletX[i] = x + PLAYER_WIDTH / 2;
      bulletY[i] = y + PLAYER_HEIGHT / 2;

      // set new bullet direction to player's current direction
      bulletdX[i] = Bdx;
      bulletdY[i] = Bdy;

      bulletArray[i] = true;  // index is now filled
      break;
    }
  }
}

// update bullet positions
void get_bullet_pos() {
  for (int i = 0; i < N; i++) {
    if (bulletArray[i]) {
      // change bullet position
      bulletX[i] += bulletdX[i];
      bulletY[i] += bulletdY[i];

      // removes bullet from array if it hits the edge of the screen
      // *include if coincidental with enemy position as well
      if (bulletX[i] > WIDTH || bulletX[i] < 0 || bulletY[i] > HEIGHT ||
          bulletY[i] < 0) {
        bulletArray[i] = false;  // frees up index for new bullet

        // resets bullet info but not really necessary
        bulletX[i] = 0;
        bulletY[i] = 0;
        bulletdX[i] = 0;
        bulletdY[i] = 0;
      }
    }
  }
}

// draw all existing bullets
void draw_bullet(short int colour) {
  int y, x;

  for (int i = 0; i < N; i++) {
    if (bulletArray[i]) {
      // bullet is 3x3 pixels
      for (int j = 0; j < 3; j++) {
        for (int k = 0; k < 3; k++) {
          x = bulletX[i] + j;
          y = bulletY[i] + k;
          plot_pixel(x, y, colour);
        }
      }
    }
  }
}

// clear all existing bullets
void clear_bullet() {
  int y, x;

  for (int i = 0; i < N; i++) {
    if (bulletArray[i]) {
      for (int j = 0; j < 3; j++) {
        for (int k = 0; k < 3; k++) {
          x = bulletX[i] + j;
          y = bulletY[i] + k;
          plot_pixel(x, y, gamebg[y][x]);
        }
      }
    }
  }
}
