// calculate enemy movement using line algorithm from lab 7
// each enemy moves in a straight line from their current position to the
// player's current position we use the line algorithm to choose which direction
// the enemy should move in according to the line calculated
void get_enemy_pos() {  // COPY LINE ALGORITHM!

  // bool exit = false;

  int y0, y1, x0, x1, temp;

  for (int i = 0; i < E_N; i++) {
    if (enemyArray[i]) {
      y1 = enemy_y[i];
      x1 = enemy_x[i];

      y0 = y;
      x0 = x;

      // check steepness to count by x or y
      bool steep = abs(enemy_y[i] - y) > abs(enemy_x[i] - x);

      // count by y if steep
      if (steep) {
        y1 = enemy_x[i];
        y0 = x;
        x1 = enemy_y[i];
        x0 = y;
      }

      // check direction to count in (+ to - or vice versa)
      if (x > enemy_x[i]) {
        temp = x1;
        x1 = x0;
        x0 = temp;

        temp = y1;
        y1 = y0;
        y0 = temp;
      }

      // slope, error, and determine step up/right or down/left
      int deltax = x1 - x0;
      int deltay = abs(y1 - y0);
      int error = -(deltax / 2);
      int y_plot = y0;
      int y_step;

      if (y0 < y1) {
        y_step = 1;
      } else {
        y_step = -1;
      }

      // loop to draw line pixel by pixel from start to end
      for (int j = x0; j <= x1; j++) {
        // plot_pixel(j, y_plot, 0xF81F);
        //  line must be continuous, only plot the pixel 1 px adjacent to enemy
        if (steep &&
            (abs(enemy_y[i] - j) == 1 || abs(enemy_x[i] - y_plot) == 1)) {
          // x = y_plot
          if (enemy_x[i] < y_plot && enemy_x[i] + ENEMY_WIDTH + 1 < WIDTH) {
            dx_e[i] = 1;
          } else if (enemy_x[i] > y_plot && enemy_x[i] - 1 >= 0) {
            dx_e[i] = -1;
          } else {
            dx_e[i] = 0;
          }

          if (enemy_y[i] < j && enemy_y[i] + ENEMY_HEIGHT + 1 < HEIGHT) {
            dy_e[i] = 1;
          } else if (enemy_y[i] > j && enemy_y[i] - 1 >= 0) {
            dy_e[i] = -1;
          } else {
            dy_e[i] = 0;
          }

          break;
        } else if (!steep && (abs(enemy_y[i] - y_plot) == 1 ||
                              abs(enemy_x[i] - j) == 1)) {
          // x = j
          if (enemy_x[i] < j && enemy_x[i] + ENEMY_WIDTH + 1 < WIDTH) {
            dx_e[i] = 1;
          } else if (enemy_x[i] > j && enemy_x[i] - 1 >= 0) {
            dx_e[i] = -1;
          } else {
            dx_e[i] = 0;
          }

          if (enemy_y[i] < y_plot && enemy_y[i] + ENEMY_HEIGHT + 1 < HEIGHT) {
            dy_e[i] = 1;
          } else if (enemy_y[i] > y_plot && enemy_y[i] - 1 >= 0) {
            dy_e[i] = -1;
          } else {
            dy_e[i] = 0;
          }

          break;
        }

        // calculate next y point
        error = error + deltay;
        if (error > 0) {
          y_plot += y_step;
          error = error - deltax;
        }
      }

      // additional edge checker - lets enemies bounce off edges if they go out
      // of screen
      if (enemy_x[i] + ENEMY_WIDTH + dx_e[i] >= WIDTH - 1 ||
          enemy_x[i] + dx_e[i] <= 0) {
        dx_e[i] = -dx_e[i];
      }

      if (enemy_y[i] + ENEMY_HEIGHT + dy_e[i] >= HEIGHT - 1 ||
          enemy_y[i] + dy_e[i] <= 0) {
        dy_e[i] = -dy_e[i];
      }
    }
  }
}

// spawn enemies in empty array indices, update their positions, and check for
// collisions
void generate_enemy() {
  // detemine initial positions of new enemies in empty array indices
  for (int i = 0; i < E_N; i++) {
    if (!enemyArray[i]) {
      // randomize edge for enemy generation
      int rand_number = rand() % 4 + 1;
      if (rand_number == 1) {  // left edge
        enemy_x[i] = 0;
        enemy_y[i] = rand() % (HEIGHT - ENEMY_HEIGHT - 1);

      } else if (rand_number == 2) {  // right edge
        enemy_x[i] = WIDTH - ENEMY_WIDTH - 1;
        enemy_y[i] = rand() % (HEIGHT - ENEMY_HEIGHT - 1);

      } else if (rand_number == 3) {  // top edge
        enemy_x[i] = rand() % (WIDTH - ENEMY_WIDTH - 1);
        enemy_y[i] = 0;

      } else if (rand_number == 4) {  // bottom edge
        enemy_x[i] = rand() % (WIDTH - ENEMY_WIDTH - 1);
        enemy_y[i] = HEIGHT - ENEMY_HEIGHT - 1;
      }

      enemyArray[i] = true;
    }
  }

  // check for collision between enemy and player
  for (int i = 0; i < E_N; i++) {
    if (enemyArray[i]) {
      if (x == enemy_x[i] && y == enemy_y[i]) {
        enemyArray[i] = false;
        // play death sound
        audio_playback_mono(death, death_n);
        end = true;
      }
    }
  }

  // update enemy directions
  get_enemy_pos();

  // check for collision between all bullets and all enemies
  bullet_enemy();

  // update enemy positions
  for (int i = 0; i < E_N; i++) {
    if (enemyArray[i]) {
      // change the speeds (delay) of different enemies according to counter
      // values
      if (counter == 3 && i % 2 == 0) {
        enemy_x[i] += dx_e[i];
        enemy_y[i] += dy_e[i];
      } else if ((counter == 1 || counter == 2) && i % 2 != 0) {
        enemy_x[i] += dx_e[i];
        enemy_y[i] += dy_e[i];
      }

      // increment counter
      counter++;
      if (counter == 4) counter = 0;
    }
  }
}

// check if any bullets are hitting any enemies
void bullet_enemy() {
  for (int i = 0; i < N; i++) {
    for (int j = 0; j < E_N; j++) {
      // check for collision between all existing bullets and enemies
      if (enemyArray[j] && bulletArray[i] &&
          abs(enemy_x[j] - bulletX[i]) <= ENEMY_WIDTH &&
          abs(enemy_y[j] - bulletY[i]) <= ENEMY_HEIGHT) {
        // clear the colliding enemy and bullet from arrays
        enemyArray[j] = false;
        bulletArray[i] = false;

        // increment score
        score++;
      }
    }
  }
}
